import React from 'react'
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import TrapFocus from '@mui/material/Unstable_TrapFocus';

const App = () => {
  const [open, setOpen] = React.useState(false);
  return (
 <>
    <Box
      sx={{
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
      }}
    >
      <Button type="button" onClick={() => setOpen(true)}>
        Sing Up
      </Button>
      {open && (
        <TrapFocus open>
          <Box tabIndex={-1} sx={{ mt: 1, p: 1 }} style={{backGround:"blue"}}>
            <label className="d-block">
              First name: <input type="text" className="d-block"/>
            </label>
            <label className="d-block">
              Last name: <input type="text" className="d-block" />
            </label>
            <label className="d-block">
              Password: <input type="password" className="d-block"/>
            </label>
            <br />
            <Button type="button" onClick={() => setOpen(false)}>
              Close
            </Button>
          </Box>
        </TrapFocus>
      )}
    </Box>
    </>
  )
}

export default App
